import React from "react";

interface LevelTickerProps {
  user: {
    name: string;
    image: string;
    earnPerTap: number;
    coinsToLevelUp: number;
    profitPerHour: number;
    totalCoins: number;
  };
}

const LevelTicker: React.FC<LevelTickerProps> = ({ user }) => {
  return (
    <div className="level-ticker">
        <LevelTickerItem label="Earn Per Tap" value={user.earnPerTap} />
        <LevelTickerItem label="Coins To Level Up" value={user.coinsToLevelUp} />
        <LevelTickerItem label="Profit Per Hour" value={user.profitPerHour} />
    </div>
  );
};
const LevelTickerItem: React.FC<{ label: string; value: number }> = ({ label, value }) => {
  return (
    <div className="level-ticker-item">
      <p className="level-ticker-label">{label}</p>
      <p className="level-ticker-value">{value}</p>
    </div>
  );
}

export default LevelTicker;
